import React from "react";
import { Form, Input } from "antd";
import styled from "styled-components";

const EditFromWrapper = styled.form`
    padding: 10px;
`;

const NicknameEditForm = () => {
    return (
        <Form>
            <Input.Search
                addonBefore="닉네임"
                enterButton="수정"
            ></Input.Search>
        </Form>
    );
};

export default NicknameEditForm;
